import React from "react";
import { withStyles } from "@material-ui/core/styles";
import Button from "@material-ui/core/Button";
import Card from "@material-ui/core/Card";
import CardContent from "@material-ui/core/CardContent";
import { CardActions, CardHeader } from "@material-ui/core";
const styles = theme => ({
  HPSBlue: {
    backgroundColor: "#1C80B5",
    fontFamily: "'Roboto', 'Helvetica', 'Arial', sans-serif",
    fontSize: "18px",
    margin: theme.spacing.unit,
    width: 175,
    color: "#FFFFF"
  },
  default: {
    backgroundColor: "#F0F0F0",
    fontFamily: "'Roboto', 'Helvetica', 'Arial', sans-serif",
    fontSize: "18px",
    width: 175,
    margin: theme.spacing.unit,
    color: "#999794"
  },
  clearButton: {
    alignItems: "right",
    margin: theme.spacing.unit * 2
    // width: 175
  },
  label: {
    fontFamily: "'Roboto', 'Helvetica', 'Arial', sans-serif",
    fontSize: "18px",
    //textAlign: "center",
    margin: theme.spacing.unit * 2,
    color: "#1C80B5"
  },
  card: {
    //textAlign: "center",
    width: 720
  }
});
class BankDetails extends Component {
  constructor(props) {
    super(props);
    //     this.state = {
    //       one: "",
    //       two: "",
    //       three: "",
    //       four: "",
    //       five: "",
    //       six: "",
    //       seven: "",
    //       eight: "",
    //       nine: "",
    //       ten: "",
    //       eleven: ""
    //     };
    //   }
    this.state = {
      caseNumber: null,
      carrierCode: null,
      memberEmail: null,
      correspondanceType: null,
      notificationType: null
    };
  }

  changeCaseNumber = event => {
    this.setState({ caseNumber: event.target.value });
  };
  changeCarrierCode = event => {
    this.setState({ carrierCode: event.target.value });
  };

  changeMemberEmail = event => {
    this.setState({ memberEmail: event.target.value });
  };

  changeCorrespondanceType = event => {
    this.setState({ correspondanceType: event.target.value });
  };

  changeNotificationType = event => {
    this.setState({ notificationType: event.target.value });
  };
  handleSubmit = event => {
    console.log(this.state);
    axios.post("/reactTest", this.state);
    event.preventDefault();
  };

  render() {
    return (
      <div>
        <Container>
          <form onSubmit={this.handleSubmit}>
            <Row>
              <Col>Case Number:</Col>
              <Col>
                <input type="text" onChange={this.changeCaseNumber} />
              </Col>
            </Row>
            <Row>
              <Col> Carrier Code:</Col>

              <Col>
                <input type="text" onChange={this.changeCarrierCode} />
              </Col>
            </Row>
            <Row>
              <Col> Member Email:</Col>

              <Col>
                <input type="text" onChange={this.changeMemberEmail} />
              </Col>
            </Row>
            <Row>
              <Col> Correspondance Type:</Col>

              <Col>
                <input type="text" onChange={this.changeCorrespondanceType} />
              </Col>
            </Row>
            <Row>
              <Col> Notification Type:</Col>

              <Col>
                <input type="text" onChange={this.changeNotificationType} />
              </Col>
            </Row>
            <Row>
              <Col>
                <input type="submit" value="Submit" />
              </Col>
            </Row>
          </form>
        </Container>
      </div>
    );
  }
}
export default withStyles(styles)(BankDetails);
